&quot;Just as your birth didn't inspire me, your death won't mean anything to me.&quot;

Jaina reincarnated as a supporting character who was born as mixed blood of human-dragon and died miserably after being neglected. She is branded as an unclean entity and was abandoned by the dragons.

And the first time she met her father, the lord of the tower, Diamide, he just looked at her coldly, as though he didn't feel any sense of intimacy to his daughter as described in the original.

&quot;Is that the one you called my daughter?&quot;

Jaina flinched as he approached and lowered her sight.

&quot;Blue eyes&hellip; but that's not a proof that she's my daughter. You could have brought me a child born with another human.&quot;

And so he went back leaving her alone and Jaina was living in the shabby warehouse of the tower.

Rather than making vain efforts to get into the eyes of his father, the lord of the tower, she decided to have a small luxury that she had never experienced even in her previous life before her death.

&quot;You don't have to think of me as your daughter. I won't call you 'Father' either.&quot;

&quot;&hellip;&quot;

&quot;Tower's lord?&quot;

So is the father, who should've been indifferent, starting to get obsessed? Father, can you just leave me alone?

Your first ever girlfriend, the teacher you loved back in school, your friend&rsquo;s mother whom you&rsquo;ve always looked up to, the colleague at work that somehow interests you etc...
People like us who just started loving someone else, lead such strong, beautiful and refreshing lives.

The scenery which you vividly remember will be changed with your aspirations. 
