Aoko is a ceramic painter at Hasami Wares Pottery, when suddenly an unfriendly and unapproachable man named Tatsuki arrives from overseas. Rejecting her way of life by telling her he isn't interested in painted ceramics, Aoko feels dejected, but can't help but be drawn to Tatsuki's ceramics&hellip;

This is a mature love story of a man and woman, both fascinated by ceramics.

Natsuki has struck out at speed dating a bunch of times and doesn't know what to do to improve her luck with men. Then, one day, as she's walking home drunk, Natsuki visits a shrine she used to play at as a kid and prays to the spirit there for a boyfriend... 

When she does, a hot and wild-looking guy in a kimono suddenly appears before her and unexpectedly says, &quot;I'll be your boyfriend if you'll have me!&quot; 

Since she's drunk and the guy's also her type, Natsuki doesn't hesitate to accept his offer... but then they're suddenly in her bed at home and he starts taking her clothes off!

My name is Amy.

Reincarnating as the little sister of a character from a book I read in my previous life was great, but...

On my 16th birthday, my older sister said she had something special prepared and picked up a guy in the forest?!?

&quot;Picking up&quot; a &quot;guy&quot; was surprising enough, but that guy was actually the Mad Archduke (...and male lead) who was a child by day and adult by night because of a curse-like spell!

He was &quot;Lennox Iberich.&quot;

&quot;Who are you.&quot;
&quot;I-I was the one who picked you up and brought you here!&quot;

To prevent the original plotline of my sister dying after picking up the male lead, I had no choice but to raise the death flag instead. But... 

&quot;Amy. I can only see you at night. There's no meaning to a night without you.&quot;

...Huh?
This... wasn't it a &quot;death&quot; flag, not a &quot;love&quot; flag...?
