Six months after the world ended, a young man continues to live with his manager at a shopping mall. The rest had left, believing a rumor of salvation if they manage to reach the centre.

During one of his rounds, he finds the first living person he's seen in a while. The girl who introduced herself as &quot;Romero&quot;, was roaming not for food, water, or salvation&mdash;but rather, for a movie...?! &quot;Who cares about humanity! The world is already up in flames, so why not just kick back and watch a movie?&quot;

An up-and-coming author's exhilarating debut work! Nothing beats watching a flick during the end of the world!

